import React, { Component } from "react";
import { Link } from "react-router-dom";

class Navbar extends Component {
  state = {
    Nav: [
      {
        name: "Discover",
        link: "/discover"
      },
      {}
    ]
  };

  render() {
    return (
      <React.Fragment>
        <nav>
          <ul>
            <Link to="/test">Discover</Link>
          </ul>
        </nav>
      </React.Fragment>
    );
  }
}

export default Navbar;
